import React from 'react';
import './index.css'; 
import tannTrimImage from './TANNTRIM.png'; 

const TannTrim = () => {
  return (
    <div className='topcontainer'>
        <div className="tann-trim-container">
        <img src={tannTrimImage} alt="TANN TRIM" />

        </div>
    </div>
  );
}

export default TannTrim;
